import React, { Component } from 'react'

class ColorContainer extends Component {
    render(){
        return(
            <div className="ColorContainer">
                <div style={{backgroundColor: this.props.colorCode}}>{this.props.colorName}</div>
            </div>
        )
    }
}

export default ColorContainer;
